  \"mobile-acoustical-bat-monitoring-2012-annual-report-for-dahomey-national-wildlife-refuge\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This report summarizes bat calls collected
  along transects at your station in 2012 at Dahomey NWR. Calls were classified using
  EchoClass(v1.1) software, but classification of calls to species is not reported
  at this time due to ongoing software assessment and validation. Calls were geo-referenced
  and spatially projected for each survey period to identify relative bat use along
  transects. We will provide a revised annual summary report, transect shapefiles,
  and spatially referenced data output files once robust classifications to species
  are available. For surveys in which GPS data were not collected, a summary of the
  calls is presented without spatial reference. The report contains summary information
  of acoustical bat surveys for 2012 at Dahomey NWR.\",\n\t\"license_title\": \"License
